import React, { useState } from 'react';
import { Switch, Route } from 'react-router-dom';

import Calculate from './Calculate';
import CountDown from './CountDown';
import LogInfo from './LogInfo';
import LogItem from './LogItem';
import Home from './Home';

function NavRoute() {
	function performSignIn() {
		let headers = new Headers();
	
		// // headers.append('Content-Type', 'application/json');
		// // headers.append('Accept', 'application/json');
		// // headers.append('Authorization', 'Basic ' + base64.encode(username + ":" +  password));
		// headers.append('Origin','http://localhost:3001/users');
	
		// fetch( {
		// 	mode: 'cors',
		// 	credentials: 'include',
		// 	method: 'GET',
		// 	headers: headers
		// })
		// .then(response => response.json())
		// .then(json => console.log(json))
		// .catch(error => console.log('Authorization failed : ' + error.message));
	}
	// performSignIn()
	fetch('http://localhost:3001/users', {
		headers: {
			// 'Content-Type': 'application/json'
		}
	})
	// .then(response => response.json())
	.then(data => data.text())
	.then(data => console.log(data));
	// console.log(performSignIn());
	let [calcArr, setCalcArr] = useState([]);
	// console.log(calcArr);

	let changeCalcHandler = (arr) => {
		setCalcArr((prev) => [...prev, arr]);
	};

	return (
		<Switch>
			<Route exact path='/'>
				<Home />
			</Route>
			<Route path='/calc'>
				<h1>calculate</h1>
				<Calculate onCalcChange={changeCalcHandler} />
			</Route>
			<Route path='/count'>
				<CountDown number={100} />
			</Route>
			<Route exact path='/log'>
				<LogInfo resoultArr={calcArr} />
			</Route>
			<Route path='/log/:id' component={LogItem} />
		</Switch>
	);
}

export default NavRoute;
